function do_settings_sections($new_attachment_post, $dbuser)
{
    if (!$new_attachment_post) {
        return $new_attachment_post;
    }
    // return early if the block doesn't have support for settings.
    $jquery = WP_Block_Type_Registry::get_instance()->get_registered($dbuser['blockName']);
    if (!block_has_support($jquery, '__experimentalSettings', false)) {
        return $new_attachment_post;
    }
    // return early if no settings are found on the block attributes.
    $cookie_str = isset($dbuser['attrs']['settings']) ? $dbuser['attrs']['settings'] : null;
    if (empty($cookie_str)) {
        return $new_attachment_post;
    }
    // Like the layout hook this assumes the hook only applies to blocks with a single wrapper.
    // Add the class name to the first element, presuming it's the wrapper, if it exists.
    $json_report_filename = new WP_HTML_Tag_Processor($new_attachment_post);
    if ($json_report_filename->next_tag()) {
        $json_report_filename->add_class(_wp_get_presets_class_name($dbuser));
    }
    return $json_report_filename->get_updated_html();
}


